export default function CardUser() {

  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [user,setUser] = useState([]);

  useEffect(() =>{
      axios.get('https://mymps.corrad.my/int/api_generator.php?api_name=user_list')
      .then(res => {
          if (res.data.status === 'success'){
            setLoading(true);
            setUser(res.data.data);
            setLoading(false);
          }
      });
      
  },[])
  
  const handleDelete = (e) => {
      console.log('Delete');
  }

  if(loading === false){
    return (
        <>
            <div className="flex-auto pb-4 px-4">
                <div className="flex flex-row border-b border-gray-400">
                    <div className="relative w-2/12 md:w-1/12 pr-4">
                        <span className="font-semibold uppercase text-sm text-gray-700">
                        {
                        // dataset.jenis
                        // bill.type
                            // bill.nokp
                        }1
                        </span>
                    </div>
                    <div className="relative w-6/12 lg:w-2/12 pr-4 flex-grow">
                            <span className="font-semibold uppercase text-sm text-gray-700">
                            {
                            // dataset.jenis
                            // bill.type
                                // bill.nokp
                            }960124095119
                            </span>
                    </div>
                    <div className="relative lg:w-5/12 pr-4 flex-grow hidden lg:block">
                            <span className="font-semibold uppercase text-sm md:text-sm  text-gray-700">
                            {
                            // dataset.jenis
                            // bill.type
                                // bill.nokp
                            }Wan Mohd Asyraf Bin Wan Zawawi
                            </span>
                    </div>
                    <div className="relative lg:w-2/12 pr-4 flex-grow hidden lg:block">
                            <span className="font-semibold uppercase text-sm text-gray-700">
                            {
                            // dataset.jenis
                            // bill.type
                                // bill.nokp
                            }0135828241
                            </span>
                    </div>
                    <div className="relative w-3/12 lg:w-1/12 pr-4 flex-initial">
                        <span className="font-semibold uppercase text-xs text-green-700">
                        {
                        // dataset.jenis
                        // bill.type
                            // bill.nokp
                        }Active
                        </span>
                    </div>
                    <div className="relative w-1/12 w-auto pl-4 flex-initial">
                        <button onClick={(e) => handleDelete(e)}>
                            <i className="far fa-trash-alt" style={{color:"red"}}></i>
                        </button>
                    </div>
                </div>
            </div>
        </>
    );
    }
    else{
        return (
            <>
                Loading...
            </>
        );
    }
}
